import service from './DataService'
const handleClick=(id)=>{
  service.del(id)
}
const Number=(props)=>{
    console.log(props)
    const getNames =() => props.persons.filter(p => props.smode==='n'?true:p.name.toLowerCase()===props.searchString.toLowerCase()).map((p)=> <li key={p.id}>{p.name} {p.number} <button onClick={handleClick()}/></li>)
    return ( 

      <ul>{getNames()}</ul>

    )
  }

  export default Number
